import React from "react";
import PropTypes from "prop-types";

const Message = ({ msg }) => {
  return (
    <div
      className="alert alert-info alert-dismissible fade show mt-4 "
      role="alert"
    >
      <center>{msg}</center>
      <button
        type="button"
        className="close"
        data-dismiss="alert"
        aria-label="Close"
      >
        <span aria-hidden="true">&times;</span>
      </button>
    </div>
  );
};

Message.propTypes = {
  msg: PropTypes.string.isRequired,
};

export default Message;

